import React, { Component } from 'react';
import Todoitem from "./Todoitem";

/* function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Hello World</h1>
      </header>
    </div>
  );
} */

class Todo extends Component {
  render(){
    return this.props.todos.map((todo) => (
        <Todoitem todoit = {todo} />
    ));
  }
}

export default Todo;
